import React from 'react'
import SmallBtn from '../components/UI/SmallBtn'

function PersonalMain(props) {
  return (
    <div>
      <span><SmallBtn color='lightgrey' text='답변대기'/></span>
      <span>{porps.title}</span>
    </div>
  )
}

export default PersonalMain
